export default {
  testEnvironment: "node",
  transform: {},
  roots: ["<rootDir>/tests"],
  collectCoverage: true,
  collectCoverageFrom: [
    "controllers/**/*.js",
    "models/**/*.js",
    "middleware/**/*.js",
    "routes/**/*.js",
    "server.js"
  ],
  coverageReporters: ["text", "html"],
  coverageThreshold: {
    global: {
      branches: 70,
      functions: 75,
      lines: 75,
      statements: 75
    }
  }
}

const request = require("supertest");
const express = require("express");

const app = express()
app.get("/ping", (req, res) => res.json({ msg: "pong" }))

describe("Integration Test (Server)", () => {
  test("GET /ping returns pong", async () => {
    const res = await request(app).get("/ping")
    expect(res.statusCode).toBe(200)
    expect(res.body.msg).toBe("pong")
  })
})

describe("System Test (Server)", () => {
  test("System environment variable check", () => {
    process.env.NODE_ENV = "test"
    expect(process.env.NODE_ENV).toBe("test")
  })
})

describe("Sample Unit Test (Server)", () => {
  test("Simple addition check", () => {
    const sum = 2 + 3
    expect(sum).toBe(5)
  })
})
